webpackJsonp([3332092574700],{7692:function(e,t){e.exports={data:{post:{html:"<p>My son was born 30 years to late to believe it, but <a href=\"http://www.kottke.org/remainder/06/09/11805.html\">kottke</a> gets it right. The movies don't have numbers, they're called Star Wars, Empire, and Jedi. Some lame prequels came later. And Han shot first. Really.</p>\n<p>I doubt that I'll buy the new original version DVDs, though. How much money does George Lucas need, anyway.</p>",fields:{title:"Han Shot First. Really.",date:"14 Sep 2006",url:"https://papascott.de/2006-09-14-han-shot-first-really/"}}},pathContext:{slug:"/2006-09-14-han-shot-first-really/",prev:{fields:{title:"GEZ: The Coinslot on your PC",date:"14 Sep 2006",slug:"/2006-09-14-gez-the-coinslot-on-your-pc/"}},next:{fields:{title:"Gammelgemuse",date:"16 Sep 2006",slug:"/2006-09-16-gammelgemuse/"}}}}}});
